import React from "react";
import '../assets/styles/passwordModal.css';

const PasswordModal = (props) => {
    return(
        <>
            <div className="passwordModal_body">
                <div className="passwordModal_style text-center pt-4 pb-4">
                    <h6>비밀번호</h6>
                    <input type="text" style={{float:'left',width:100, height:20}}></input>
                    <button type="button">확인</button>
                </div>
            </div>
        </>
    )
}

export default PasswordModal;
